(20153, 9117, 2181, 5, 'Luca', '', '2009-12-02 00:00:00', 2009, 20, 0, 4, 'I’ve been living on my suitcase 我和我的行李相依為命\nTraveling upon my own will 隨意流浪\nFollow the wishing star 跟著希望之星\nAnd the vibrate of my guitar 與我的吉他一起尋找感動\n\nOn the street, in my boots and jeans\n陌生大街 踩過我的牛仔褲與長靴\nWay out loud in the people stream\n穿梭在喧囂的人群\nMaking my own journey in a way of come and leave\n來去間 用我的方式旅行\n\nBut you stand there silent on the outskirt of those lazy men\n而你靜靜的佇立在那些無精打采的人群邊緣\nWith the quiet eyes and a cell phone on your hand\n透過妳冷靜的眼睛與手上的手機\nI thought I saw you somewhere but I haven’t seen you since then\n也許我曾經見過妳 卻又失去妳的蹤影\nThe phone you left behind it’s left too soon\n我想 妳太快把手機遺留下來\n\nYou turn me upside down 妳讓我神魂顛倒\nThe way you’re pushing around 用妳獨特的方法\nI can’t believe how you made me lost and found 我無可置信的神魂顛倒\nYou make me back on to the ground 妳讓我的心重返地球\nYou’re the ear that I wanna sing to 妳讓我只想為妳歌唱\nNow you’re all about the cell phone 妳只存在手機裡\nAnd I’m all about you now 而我的腦海 只存在妳\n\nThere’re many places that I can’t dream of\nMake my life go stronger along the way\nNot like I’ve been told you’d be always on your own\nSummer grill and winter chill and\nthe memories been seasoned\nEveryday will be a brand new day to go\n\nBut you stand there silent on the outskirt of those lazy men.\nWith the quiet eyes and a flower on your head\nI thought I saw you somewhere but I’ve never seen you since then\nThe song I wrote for you I sing alone\n\nYou turn me upside down 妳讓我神魂顛倒\nThe way you’re pushing around 用妳獨特的方法\nI can’t believe how you made me lost and found 我無可置信的神魂顛倒\nNow I back on to the ground 妳讓我的心重返地球\nYou’re the ear that I wanna sing to 妳讓我只想為妳歌唱\nNow you’re all about the cell phone 妳只存在手機裡\nAnd I’m all about you now 而我的腦海 只存在妳\n\nBefore I turn myself to bed 每當我準備入睡\nI can recall your face 妳的臉就會浮現\nSuch a lovely cell phone girl 如此動人的手機裡的女孩\n\nHow can I find you again 我如何能再見到妳\nWould you take me by the hand 妳可願意與我相見\nWith the moonlight in your eyes 為了看見妳眼中的月光\nI’ll turn back to you, turn back to you. 我會努力再回到妳身邊\n\nYou turn me upside down 妳讓我神魂顛倒\nThe way you’re pushing around 用妳獨特的方法\nI can’t believe how you made me lost and found 我無可置信的神魂顛倒\nNow I back on to the ground 妳讓我的心重返地球\nYou’re the ear that I wanna sing to 妳讓我只想為妳歌唱\nNow you’re all about the cell phone 妳只存在手機裡\nAnd I’m all about you now 而我的腦海 只存在妳\n\nYou turn me upside down 妳讓我神魂顛倒\nThe way you’re pushing around 用妳獨特的方法\nI can’t believe how you made me lost and found 我無可置信的神魂顛倒\nNow I back on to the ground 妳讓我的心重返地球\nYou’re the ear that I wanna sing to 妳讓我只想為妳歌唱\nAnd you’re all about the cell phone 妳只存在手機裡\nAnd I’m... all about you now 而我的腦海 只存在妳', 'I’ve been living on my suitcase \nTraveling upon my own will \nFollow the wishing star \nAnd the vibrate of my guitar \n\n\nOn the street, in my boots and jeans \nWay out loud in the people stream \nMaking my own journey in a way of come and leave \n\n\nPrechorus\nBut you stand there silent on the outskirt of those lazy men.\n\n\nWith the quiet eyes and a cell phone on hand\n\n\n\nI thought I saw you somewhere but I haven’t seen you since then\n\n\nThe phone you left behind it’s left too soon.\n\n\n\nChorus\nYou turn me upside down\nThe way you’re pushing around \nI can’t believe you made me lost and found \n\nYou make me back on to the ground \nYou’re the ear that I wanna sing to \nYou’re all about the cell phone \nAnd I’m all about you now \n\nBridge\n\nBefore I turn myself to bed \nI can recall your face \nSuch a lovely cell phone girl \n\nHow can I find you again\nWould you take me by the hand \nWith the moonlight in your eyes \nI’ll turn back to you, turn back to you.', 334, '', '洪璽開', '洪璽開', '陳品先', '', '', 1, 1, 0, '2009-12-10 02:16:56', '2015-03-12 13:40:29', '0000-00-00 00:00:00'),
(20154, 9117, 2181, 7, 'Who Said It''ll Be Alright?', '', '2009-12-02 00:00:00', 2009, 20, 1, 4, 'Well I’m wondering if the world is still turning\nCause I feel all stuck in this lifeless eternity\nThe sound of your voice is mute in the airflow\nI’m left along here, no way to be out\n\nWe’ve been counting the days in numbers and sunrises\nTry out best to pretend we’re strong enough to protect\nThat’s when we wonder if the world’s too hard on us\nOr we really fail them, again and again\n\nCuz what I want is not what I need\nAll the things I held tight inside just came out all wrong\nAnd what I feel, don’t mean anything to me\nLike I’m finally let out loud\nBut not even be found\nAnd who said it’ll be alright?\n\nWill lend me your words that I’m too tough to say\nWill you show me the light cause I can’t find the way\n\nOh what I want is not what I need\nAll the things I held tight inside just came out all wrong\nAnd what I feel, don’t mean anything to me\nLike I’m finally let out loud\nBut not even be found\nAnd who said it’ll be alright?', 'Well I’m wondering if the world is still turning\n\nCause I feel all stuck in this lifeless eternity\n\nThe sound of your voice is mute in the airflow\n\nI’m left along here, no way to be out\n\nWe’ve been counting the days in numbers and sunrises\n\nTry out best to pretend we’re strong enough to protect\n\nThat’s when we wonder if the world’s too hard on us\n\nOr we really fail them, again and again\n\nWhat I want is not what I need\n\nAll the things I held tight inside just came out all wrong\n\nWhat I feel, don’t mean anything to me\n\nLike I’m finally let out loud\n\nBut not even be found\n\nAnd you said it’ll be alright?\n\nWill lend me your words that I’m too tough to say\n\nWill you show me the light cause I can’t find the way', 279, '', '陳品先', '洪璽開', '陳品先', '', '', 1, 1, 0, '2009-12-10 02:18:31', '2015-03-12 13:40:29', '0000-00-00 00:00:00'),
(20155, 9117, 2181, 8, '大雨大禹', '', '2009-12-02 00:00:00', 2009, 20, 0, 4, 'Who can survive this lonely kind of life? \nHow can I tell a lie to leave you alone tonight?\nWhen the sky can''t help crying, then who babysit the earth? \nHow can I save this world as you did?  \n臉色慘白，燈光昏暗，每天，每天，每天。 \n快不快樂，天空的顏色，不像夢裡那樣清澈。  \n\n這個城市，像一片海，點點雨滴，淋濕我的臉。\n雨這麼快，什麼都來不及交待，就這樣，未來一切重來。  \n\n大雨，大雨，嘩啦啦，伊耶，伊耶。  \n\nWho can survive this lonely kind of life? \nHow can I tell a lie to leave you alone tonight?\nWhen the sky can''t help crying, then who babysit the earth? \nHow can I save this world as you did?  \n\n不理不睬，這個陌生年代，只剩，無奈，感慨。 \n靈魂出走，搭造一座方舟，從此獨自異域漂泊。\n\n大雨，大雨，嘩啦啦，伊耶，伊耶~~~~。\nWho can survive this lonely kind of life? \nHow can I tell a lie to leave you alone tonight?\nWhen the sky can''t help crying, then who babysit the earth? \nHow can I save this world as you did?  \n地球已經不旋轉，像你的腦袋。\n三過你的家門，卻不進來。Tell me why~~~~~? \n\n早上七點，拉開門簾。\n窗外，已經，放晴。', '\n臉色慘白，燈光昏暗，每天，每天，每天。\n快不快樂，天空的顏色，不像夢裡那樣清澈。\n\n這個城市，像一片海，點點雨滴，淋濕我的臉。\n雨這麼快，什麼都來不及交待，就這樣，未來一切重來。\n\n大雨，大雨，嘩啦啦，伊耶，伊耶。\n\nWho can survive this lonely kind of life?\nHow can I tell a lie to leave you alone tonight?\nWhen the sky can''t help crying, then who babysit the earth?\nHow can I save this world as you did?\n\n不理不睬，這個陌生年代，只剩，無奈，感慨。\n靈魂出走，搭造一座方舟，從此獨自異域漂泊。\n\n大雨，大雨，嘩啦啦，伊耶，伊耶~~~~。\n\n地球已經不旋轉，像你的腦袋。\n三過你的家門，卻不進來。Tell me why~~~~~?\n\n早上七點，拉開門簾。\n窗外，已經，放晴。\n', 239, '', '陳品先、洪璽開、游睿威', '洪璽開、小君', '陳品先', '', '', 1, 1, 0, '2009-12-10 02:19:47', '2015-03-12 13:40:29', '0000-00-00 00:00:00'),
(20156, 9117, 2181, 10, '北投果汁', '', '2009-12-02 00:00:00', 2009, 20, 0, 4, '清香 散布身旁\n閃爍幻覺翻動想像\n迴盪 酸甜的清涼\n溫潤 越過邊框\n瀰漫著吸引我的眼光\n掙扎 選擇的徬徨\n\n浸潤我的需要 (融化在你的微笑) 泡沫化的味道\n\nSTIR UP 氣味和慾望\nWAKE UP 苦澀的變化\nMIX UP 真實完整的蘊釀\nWAKE UP 甜蜜的渴望\nSTIR UP 壓縮和釋放\nMIX UP 沾染黏膩的妄想\n畫過你臉龐\n\n浸潤我的需要 (融化在你的微笑) 泡沫化的味道\n\nSTIR UP 氣味和慾望\nWAKE UP 苦澀的變化\nMIX UP 真實完整的蘊釀\nWAKE UP 甜蜜的渴望\nSTIR UP 壓縮和釋放\nMIX UP 沾染黏膩的妄想\n\nSTIR UP 氣味和慾望\nWAKE UP 苦澀的變化\nMIX UP 真實完整的蘊釀\nWAKE UP 甜蜜的渴望\nSTIR UP 壓縮和釋放\nMIX UP 沾染黏膩的妄想\n畫過你臉龐', '', 155, '', '陳品先', 'FrankWW', '陳品先', '', '', 1, 1, 0, '2009-12-10 02:21:00', '2015-03-12 13:40:29', '0000-00-00 00:00:00'),
(20157, 9117, 2181, 9, '所以說', '', '2009-12-02 00:00:00', 2009, 20, 0, 4, '如果說 有一天 會上太空\n要乘著風 徜徉在 白色綠洲\nGet away, and beat the heck out of it, I have my own place to go\n\n或著是 青春的 搖滾司機\n旋轉著 kaylinchia 送你回家\nCome with me, and kick the sorry ass that trips you on\n\n桌上的半杯咖啡 再次延續著 昨夜未完成的敷衍\n當太陽慢慢升起 你又將告別 蔚藍的天\n\n天空是窗的形狀 生活也只有 日出之後就是夕陽\n臉上的匆忙就像 遠古的海洋 一般蒼涼\n\n似是而非的複雜信仰 叫我怎麼低頭不亂想\n\n所以說 這一次 不再徬徨\n走帶著傷 你也要 更加堅強\nGet away, the heck with what they say\n\n不能說 夢想在 未知遠方\n你只能 坐下來 慢慢感傷\nCome with me, and kick the sorry ass that trips you on\n\n所以說 這一次 不再徬徨\n走帶著傷 你也要 更加堅強\nGet away, the heck with what they say\n\n不能說 夢想在 未知遠方\n你只能 坐下來 慢慢感傷\nCome with me, 反正結果不就是這樣\n\n頭髮都會掉光\n像早上的太陽\n只剩一堆鼻毛\nYeah yeah~', '', 246, '', '陳品先', '洪璽開、鄭鈞鴻、官苑傑、江艾穎', '陳品先', '', '', 1, 1, 0, '2009-12-10 02:24:11', '2015-03-12 13:40:29', '0000-00-00 00:00:00'),
