(20170, 1483, 2195, 10, '藍星', '', '2009-09-09 00:00:00', 2009, 20, 0, 7, '', '藍星\n\n悄悄的　我就走在妳的身後　每天都這樣和妳擦身而過\n遠遠　看著妳的背影　總是離我遠走　慢慢的感覺空氣一直噓我\n夜晚的天空裡出現一顆藍色的星星\n當我看到妳時 心裡真的很高興\n我把這一場賭注全下在這一局\n雖然不知道結果但我跟妳說\n喔~因為　我愛妳　愛妳　愛妳　嗚喔~ 耶~\n\n懶懶的　每天想著妳的夜晚　就是因為妳讓我無法入睡\n遠遠的　看著妳的出現　有種幸福的味道　我就是喜歡這樣微笑的妳\n夜晚的天空裡出現一顆藍色的星星\n當我看到妳時 心裡真的很高興\n我把這一場賭注全下在這一局\n雖然不知道結果但我跟妳說\n喔~因為　我愛妳　愛妳　愛妳　嗚喔~ 耶~', 269, '', '', '', '', '', '', 1, 1, 0, '2009-12-10 16:41:45', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
