(20182, 6385, 0, 1, '等待寒流 (男聲獨唱)', '台北邊陲的原住民部落，諸如溪洲、三鶯、崁津、小碧潭、撒烏瓦知等，近年來的遭遇跟努力，促成了這首歌的創作。我們願意釋出這首歌的重製、散布、演出與衍生創作權，如果您也反對公權力迫遷，歡迎將〈等待寒流〉自由運用於有利部落的行動，請來信 summerbred@gmail.com 索取原始錄音檔案；謝謝大家。', '0000-00-00 00:00:00', 2009, 0, 1, 5, '昨夜 // 陽光迴避殘夢 // 穿著制服的寒流 // 冷冽直逼胸口\r\n今早 // 沒有春天影蹤 // 西裝畢挺的寒流 // 哄騙我進牢籠\r\n擋不住 // 歷史在腳下癡傻的流動 // 而枕邊就是橋墩跟北風\r\n\r\n厚繭瘡痂在背後 // 荊棘拌索在前頭 // 後山濃霧前溪濁\r\n\r\n我等待寒流 // 我迎接寒流 // 雖然血液的濃度不同\r\n我等待寒流 // 我迎接寒流 // 就算每一方田園都陷落', '', 246, '', '阿亮', '阿亮', '夏生', 'Ramherst/ 南海藝廊', '', 1, 1, 0, '2009-12-12 15:21:34', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
