(20184, 153, 0, 1, '葡萄人追逐戰', '渲染 2010 最新長篇創作——葡萄人三部曲之首波強打\r\n\r\n在這個無聲的世界，所有聲響都是被禁止的\r\n警察的出現，為的只是限制任何聲響的發生\r\n\r\n當失去聲音變成了一種習慣\r\n人們開始相信視覺所看到的一切表象 \r\n\r\n微醺的葡萄人，無法勉強自己存在於失去聲音的世界\r\n世界既有的框架侷限不了內在的反動\r\n所有思緒傾洩而出 \r\n\r\n葡萄人決定與警察展開一場聲音的追逐　...to be continued\r\n\r\n\r\n更多鼓打鍵盤的資訊請上：\r\nhttp://blog.roodo.com/drumnkbass/\r\nhttp://www.facebook.com/drumnkbass', '0000-00-00 00:00:00', 2009, 0, 2, 7, '', '', 266, '', '鼓打鍵盤', '', '', '', '', 1, 1, 0, '2009-12-14 00:30:58', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
