(20186, 4128, 2162, 1, '法式綺思-Restart', 'Vocal 黃家葳(綺夢)\r\nDrum 陸浩釗(大爆)\r\nGuitar 江鎮宇,邵建銘(哨子麵)\r\nBass 蕭巧玫(玫玫)', '2009-12-23 00:00:00', 0000, 10, 0, 7, '迎著風 夕陽下 晃動著腳指頭\r\n我的心  拍打著狂亂的節奏\r\n空氣裡 記憶中 瀰漫著懷舊的氣味正濃\r\n\r\n傾洩而下的想念泛流\r\n\r\n飄揚的  長頭髮  連結著世界兩端的你我\r\n\r\n這瞬間  我們有一樣的脈動\r\n\r\n穿越山 穿越海 穿越過世界的盡頭\r\n放手飛 勇敢讓心自由\r\n\r\nShadow of my life\r\nyou will be free tonight\r\nyou know you will live your life\r\nwindblows and free my mind\r\ni will not look back\r\ni know i will be free started tonight', '', 243, '', '黃家葳(綺夢)', '黃家葳(綺夢)', '哨子麵', '良肯音樂', '', 0, 1, 0, '2009-12-15 04:17:39', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
(20187, 4128, 2162, 2, '小宇宙樂團-小故事', '', '2009-12-23 00:00:00', 0000, 10, 0, 7, '我能看見你眼中  星星閃耀\r\n當我走進你視線裡那一秒\r\n\r\n一切都會很美好  一切都很美妙\r\n故事就要展開了  我知道\r\n\r\n有天我會  獨享你的笑  有天我會  和你手牽著手\r\n有天我會  佔據你的擁抱  直到我以為的天荒地老\r\n\r\n我能看見你眼中  星星閃耀\r\n當我走進你視線裡那一秒\r\n\r\n一切都會很美好  一切都很美妙\r\n故事就要展開了  我知道\r\n\r\nSomeday I will see your smiles\r\nSomeday I will hold you tight\r\nSomeday I will be part of your life\r\nand the story will never end\r\nand the story will never end', '', 320, '', '陳薇宇(夢蘿)', '陳薇宇(夢蘿)', '哨子麵', '良肯音樂', '', 0, 1, 0, '2009-12-15 04:20:39', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
(20188, 4128, 2162, 3, '旋轉木妮-沈睡午後', 'Vocal 李易真(木妮)\r\nDrum 林奕廷(廷廷)\r\nKeyboard 周佩嫻(小嫻)\r\nGuitar 許俊傑(依諾)\r\nBass 楊恩頎(橘安)', '2009-12-23 00:00:00', 0000, 10, 0, 7, '一如往常滑溜溜的午後凝結的世界\r\n只剩下隨風拍打的報紙答答的唱著\r\n道路兩旁竊笑的白楊樹不停的搖擺\r\n整個世界都睡意朦朧  眼前如夢似幻\r\n\r\n劃過天邊飛機的白翅膀轉眼成一點\r\n呼嘯而過引擎聲音消失在煙塵中\r\n那總是忽隱忽現的影子蒸散在陽光裡\r\n迷矇在迷朦的午後  沉睡在沉睡的午後\r\n看不清一切\r\n\r\nSinging singing alone...Singing singing alone\r\nAnd now I''m playing my guitar\r\nMissing you alone\r\nSinging singing alone...Singing singing alone\r\nHey! Look at the bluest high\r\nMaybe one day we can tiuch the rainbow\r\nEverything will be fine\r\n\r\n', '', 226, '', '梁家維(小涼)', '小茄,梁家維(小涼)', '哨子麵', '良肯音樂', '', 0, 1, 0, '2009-12-15 04:27:27', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
(20189, 4128, 2162, 4, '坦娜普-我要在長大之前死去', 'Vocal 張嫚珈(天天)\r\nDrum 林奕廷(廷廷)\r\nGuitar 林奕辰(貝貝)\r\nBass 黃溫明(明明)', '2009-12-23 00:00:00', 0000, 10, 0, 7, '妳不喜歡我 為什麼要牽我的手\r\n妳不喜歡我 為什麼要親我的酒渦\r\n\r\n大人的世界實在有夠困難\r\n我想我永遠都不會習慣\r\n\r\n我要在長大之前死去  我要在長大之前死去\r\n這樣我就可以和松鼠一起漫步在森林中\r\n我要在長大之前死去  我要在長大之前死去\r\n天空中的彩虹就不會消失在地平線\r\n我要在長大之前死去  我要在長大之前死去\r\n黑夜中的星星也永遠不會消逝\r\n\r\n我喜歡的人也不會離開我\r\n', '', 286, '', '張嫚珈（天天）', '張嫚珈（天天）', '哨子麵', '良肯音樂', '', 0, 1, 0, '2009-12-15 04:28:41', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
(20190, 4128, 2162, 5, '濺草如茵-夢遊仙境', 'Vocal 柯如茵\r\nDrum 李宜舫\r\nKeyboard 柯如茵\r\nGuitar 柯如茵\r\nBass 邵建銘(哨子麵)', '2009-12-23 00:00:00', 0000, 10, 0, 7, '跟著笨兔子亂繞 這實在有夠搞笑\r\n到底是誰在胡鬧 我想 大聲尖叫\r\n我感覺快要發飆 怪物都沒有禮貌\r\n又忽然變大變小 快 瘋 掉\r\n\r\n撲克牌 耍大牌 沒甚麼 了不起\r\n白薔薇 氣死妳  很 故意\r\n\r\n有沒有這麼詭異 夢遊仙境\r\n能不能明天繼續 今天的旅行\r\n有沒有這麼happy 夢遊仙境\r\n帽商與紅心皇后 都 歡迎我 再 光臨\r\n\r\n跟著笨兔子亂繞 這實在有夠搞笑\r\n找不到夢的出口 不知道如何是好\r\n也許不醒來也好 夢遊也不會無聊\r\n情節都沒頭沒腦 開心就好\r\n\r\n', '', 152, '', '柯如茵', '洪誠孝(hotlatte)', '哨子麵', '良肯音樂', '', 0, 1, 0, '2009-12-15 04:35:19', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
(20191, 4128, 2162, 6, '果凍飛船-凍凍飛行船', 'Vocal 翁妮萱(小嗶),羅友成(漢堡包)\r\nDrum 曾聖瑋(小蛋頭)\r\nGuitar 羅友成(漢堡包)\r\nBass 蘇浩傳(大頭)', '2009-12-23 00:00:00', 0000, 10, 0, 7, '突然有一種感覺  又香又甜的滋味\r\n軟軟的果凍在眼前\r\n\r\n晴朗的天空和Weekend  現在是彩虹的季節\r\n就讓我們一起去冒險\r\n\r\n 快拿果凍草莓和番茄  組成凍凍飛行船\r\n\r\n加速往前  衝過天邊  一瞬間又不見\r\n彩色的煙  變成雲點  這是棉花糖世界\r\n\r\n It''s our HAPPY DAY!\r\n\r\n好想要追逐著風  被雲朵一起帶走\r\n飛到太陽的面前  對他笑一笑\r\n\r\n青蛙和小貓小狗  都是我的好朋友\r\n坐上來一起郊遊  馬上就起飛嘍\r\n\r\n YA   YAYA  YAYAYAYA\r\n啦啦  啦啦  啦啦\r\n\r\n 迎向美麗的世界\r\n 享受彩色的空間\r\n 精彩的每個瞬間\r\n', '', 191, '', '羅友成(漢堡包)', '羅友成(漢堡包)', '哨子麵', '良肯音樂', '', 0, 1, 0, '2009-12-15 04:39:00', '2015-03-12 13:40:30', '0000-00-00 00:00:00'),
